import React, { Component } from 'react';
import { Tab } from "semantic-ui-react";
import "./css/GroundStation.css";
import GroundStation from "../GroundStation";
import Playback from "../Playback";

const panes = [
    { menuItem: 'Ground Station', render: () => <GroundStation/> },
    { menuItem: 'Settings', render: () => <Tab.Pane>Settings go here</Tab.Pane> },
    { menuItem: 'Playback', render: () => <div><Playback/><Tab.Pane>Timeline goes here.</Tab.Pane></div>},
];

class GroundStationContainer extends Component {

    render(){
        return (
            <div className="groundstation_container">
                <Tab panes={panes} className="full_page" />
            </div>
        );
    }
}

export default GroundStationContainer;
